import React from 'react'
import {
    Flex,
    Box,
    Heading,
} from 'rebass';

function ProjectInfo(props) {
    return (
        <Flex>
            <Box>
                <Heading marginTop={40}>{props.children}</Heading>
            </Box>
        </Flex>
    )
}

export default ProjectInfo
